import Navbar from "../../components/Navbar/Navbar";
import Btmbar from "../../components/Btmbar/Btmbar";
import logo from '../../static/hiish.svg';
import profile from '../../static/profile.jpg';
import plus from '../../static/plus.svg';
import search from '../../static/search.svg';
import React, { useState } from 'react';

function Search() {
    const [search, setRoute] = useState(0)
    const changeToSearch = (state) => {
        setRoute(state)
    }

    return (
        <div className="flex w-screen h-screen">
            <Navbar searchActivated={search} logo={logo} profile={profile} plus={plus} search={search}/>
            <div></div>
            <Btmbar />
        </div>
    );
}

export default Search;
